import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import Card from "./Card";
import "tachyons";

ReactDOM.createRoot(document.getElementById("root")).render(
	<React.StrictMode>
		<div className="bg-light-green dib br3 pa3 ma2 grow">
			<React.StrictMode>
				<Card />
				<Card />
				<Card />
			</React.StrictMode>
		</div>
	</React.StrictMode>
);

